import React from "react";
import style from "./style.module.scss"

const ConatctScreen =()=>{
    return(
        <div className={style.contactContainer}>
        <h2 className={style.contactTitle}>Lets Connect!</h2>
        <h3 className={style.contactSubTitle}>Email me here</h3>
        <p className={style.contactPara}></p>
    </div>
    )
}
export default ConatctScreen;
